- Name: COMapImageInfo
  Id: g=e8e1e54977ac8901610d3720944c4399
  Supertype: ValueMapConverter
  ReferenceType: HasComponent
  Children:
  - Name: ns=7;Pairs
    Type: BaseObjectType
    ModellingRule: None
    Children:
    - Name: Pair
      Type: ValueMapPair
      ModellingRule: None
      Children:
      - Name: Key
        Type: BaseDataVariableType
        DataType: String
        ModellingRule: None
        Value: "1"
      - Name: Value
        Type: BaseDataVariableType
        DataType: LocalizedText
        ModellingRule: None
        Value: {"LocaleId":"en-US","Text":"1. Loosen the two quick-release handles for EOAT length adjustment.\n\n2. Slide the vacuum cup assembly to the appropriate scale setting.\n\n3. Tighten the quick-release handles for EOAT length adjustment."}
    - Name: Pair1
      Type: ValueMapPair
      ModellingRule: None
      Children:
      - Name: Key
        Type: BaseDataVariableType
        DataType: String
        ModellingRule: None
        Value: "2"
      - Name: Value
        Type: BaseDataVariableType
        DataType: LocalizedText
        ModellingRule: None
        Value: {"LocaleId":"en-US","Text":"1. Loosen the four quick-release handles for EOAT width adjustment.\n\n2. Slide the vacuum cup assembly to the appropriate scale setting.\n\n3. Tighten the four quick-release handles for EOAT width adjustment."}
    - Name: Pair2
      Type: ValueMapPair
      ModellingRule: None
      Children:
      - Name: Key
        Type: BaseDataVariableType
        DataType: String
        ModellingRule: None
        Value: "3"
      - Name: Value
        Type: BaseDataVariableType
        DataType: LocalizedText
        ModellingRule: None
        Value: {"LocaleId":"en-US","Text":"1. Loosen the orange quick adjustment handles.\n\n2. Slide the skatewheel assembly to the appropriate scale position.\n\n3. Tighten the orange quick adjustment handles.\n\n4. Repeat steps 1-3 on the opposite side of the machine."}
    - Name: Pair3
      Type: ValueMapPair
      ModellingRule: None
      Children:
      - Name: Key
        Type: BaseDataVariableType
        DataType: String
        ModellingRule: None
        Value: "4"
      - Name: Value
        Type: BaseDataVariableType
        DataType: LocalizedText
        ModellingRule: None
        Value: {"LocaleId":"en-US","Text":"1. Loosen the handle.\n\n2. Slide the minor plow assembly to the approprate scale setting.\n\n3. Tighten the handle."}
    - Name: Pair4
      Type: ValueMapPair
      ModellingRule: None
      Children:
      - Name: Key
        Type: BaseDataVariableType
        DataType: String
        ModellingRule: None
        Value: "5"
      - Name: Value
        Type: BaseDataVariableType
        DataType: LocalizedText
        ModellingRule: None
        Value: {"LocaleId":"en-US","Text":"1. Loosen the orange quick adjustment handles.\n\n2. Slide the Vertical Flap Folder to the appropriate scale position.\n\n3. Tighten the orange quick adjustment handles.\n\n4. Make the same adjustment on the other side of the machine."}
    - Name: Pair5
      Type: ValueMapPair
      ModellingRule: None
      Children:
      - Name: Key
        Type: BaseDataVariableType
        DataType: String
        ModellingRule: None
        Value: "6"
      - Name: Value
        Type: BaseDataVariableType
        DataType: LocalizedText
        ModellingRule: None
        Value: {"LocaleId":"en-US","Text":"1. Loosen the orange quick adjustment handles.\n\n2. Slide the Horizontal Flap Folder to the appropriate scale position.\n\n3. Tighten the orange quick adjustment handles.\n\n4. Make the same adjustment on the other side of the machine."}
    - Name: Pair6
      Type: ValueMapPair
      ModellingRule: None
      Children:
      - Name: Key
        Type: BaseDataVariableType
        DataType: String
        ModellingRule: None
        Value: "7"
      - Name: Value
        Type: BaseDataVariableType
        DataType: LocalizedText
        ModellingRule: None
        Value: {"LocaleId":"en-US","Text":"1. Place the adjustment crank handle on the adjustment shaft. \n\n2. Turn the adjustment crank handle to the approprate scale setting."}
